    list<int> lengthes(1, 0);
    list<int>::iterator current = lengthes.begin();
    int ans = 0;
    for (char key : keys) {
            switch (key) {
            case '\\':
                    current = lengthes.insert(++current, 0);
                    break;
            case '<':
                if (*current > 0)
                    --*current;
                else if (current != lengthes.begin())
                    current = --lengthes.erase(current);
                break;
            case '^':
                if (current != lengthes.begin()) --current;
                break;
            case '|':
                    if (++current == lengthes.end())-- current;
                break;
            default:
                    if (++*current > ans) ans = *current;

        }
    }
    cout << ans;
        return 0;
}

